 (1,'Staff List','Lost','10.15','<p>We would like to Welcome all players here at LostStory! If you have any questions please feel free to ask any of our staff members either In-Game or on Discord.&nbsp;<br />\r\n<br />\r\n<strong>&nbsp; &nbsp;Position&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Discord Name&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; In-Game Name</strong></p>\r\n\r\n<p>Administrator&nbsp; &nbsp;<strong>|</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Lost&trade;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>|</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Lost</p>\r\n\r\n<p>Game-Master&nbsp;&nbsp;<strong>|&nbsp; &nbsp; &nbsp;&nbsp;</strong>Diagnostic&nbsp; &nbsp; &nbsp; &nbsp;<strong>|&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong>Diagnostic</p>\r\n\r\n<p>Tech Support&nbsp; &nbsp;<strong>|&nbsp; &nbsp; &nbsp; &nbsp;</strong>Novellus&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>|&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong>Novellus</p>\r\n\r\n<p>Tech Support&nbsp; &nbsp;<strong>|&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong>Dibs&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>|&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong>Dibs</p>\r\n',45,0);
INSERT INTO `bit_news` (`id`,`title`,`author`,`date`,`type`,`content`,`views`,`locked`) VALUES 
 (1,'About Our Server','Lost','10.05','ct_news_notice_notice','<p>LostStory is a Maplestory Private Server that was created due to the lost nostalgia of the original game itself. We all remember back when Maplestory only had 4 classes to choose from but we decided to go with a version that is more updated and has Arans and Pirates. We feel&nbsp;there are people who played and enjoyed the old Maplestory and quit because of all the new updates. The name LostStory comes from the fact that original Maplestory has been lost and will be forever. This bringing you our server!</p>\r\n\r\n<p>Our rates are 30x|3x|2x with a quest rate of 4x. All LostStory beginner explorer maps, Legend, and Cygnus beginner jobs&nbsp;have been set to 1x experience rate to prevent over-leveling. Join us now and help the Original Maplestory be found again through our private server.<br />\r\n<br />\r\nMany updates will come throughout the life of our server. Hope all of you enjoy!</p>\r\n\r\n<p>LostStory Staff</p>\r\n',52,0),
 (2,'[BETA] Update 0.1','Lost','10.06','ct_news_gameup','<p>LostStory is now Officially Launched into BETA Update 0.1.</p>\r\n',20,0),
 (3,'[BETA] Update 0.2','Lost','10.08','ct_news_notice_notice','<p>As we have been testing various things, we realized that you were unable to reset your stats. This meaning if you wanted to become the Magician Class but you put AP into the STR Stat to help you get through the beginner maps and quests. You would not be able to get the job advancement. Here are the updates we brought to you to fix those issues.</p>\r\n\r\n<ul>\r\n	<li>Fixed the stat reset on 1st Job Advancements.</li>\r\n	<li>Removed the stat requirements for first job.</li>\r\n	<li>Set all Maple Island Maps as well as Legend and Cygnus Beginner Jobs&nbsp;to 1x exp rate and 1x quest rate to prevent over-leveling.</li>\r\n</ul>\r\n',18,0),
 (4,'[BETA] Update 0.3','Lost','10.10','ct_news_notice_notice','<ul>\r\n	<li>Removed @time command.</li>\r\n	<li>Added @lsi for Information.</li>\r\n	<li>Changed server time to correctly display our server time(PST).</li>\r\n	<li>Removed&nbsp;Command @uptime and put that info in @lsi.</li>\r\n	<li>Inkwell is now the LostStory Credit Union NPC.</li>\r\n	<li>Added @bank for LostStory Credit Union NPC.</li>\r\n</ul>\r\n',45,0);
